import React from 'react';
import RightAlignedTimeline from "../Components/RightAlignedTimeline";
import Typography from '@material-ui/core/Typography';
import Button from "@material-ui/core/Button";

export default function Background() {
  return (
   <div>
     <div>
<div>
  <Typography>Hey hey, Lorem ipsum</Typography>
  <Typography>Dolor sit amet consectetur adipisicing elit. Facere cum amet iste, commodi reprehenderit similique nesciunt quidem reiciendis debitis placeat, maiores quisquam eius. Dolore tenetur obcaecati eligendi dolorum blanditiis culpa!</Typography></div>
<div>
  If you prefer a classical resume, I share it in PDF!
  <Button variant="contained" color="secondary">
            See French CV
          </Button>
  <Button variant="contained" color="secondary">
  See English CV
          </Button>
</div>
</div>
       <RightAlignedTimeline />
   </div>
  );
};
